@app.route('/stringToImage')
def baseBackToImage():
    base64String = ''
    imageData = base64.b64decode(base64String)
    fileName = 'my_image.jpeg'
    with open(fileName, 'wb') as f:
        respo = make_response(f.write(imageData))

    # respo.mimetype = "image/jpeg"
    return respo


    